import React from 'react';
import Select from './components/Select'
import './App.css';

class App extends React.Component {

  render(){
    return (
    <div className="App">
      <Select clientData={this.clientData}/>
    </div>
    );
  }

}

export default App;
clientData = () => {
  console.log('hello world');
}
